import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';

function StaffDashboard() {
  const [stats, setStats] = useState({ total: 0, checkedIn: 0, notCheckedIn: 0 });
  const [patients, setPatients] = useState([]);
  const [error, setError] = useState('');
  const navigate = useNavigate();

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await fetch('http://localhost:5001/api/patients/stats', {
          method: 'GET',
          headers: { 'Content-Type': 'application/json' },
        });
        const data = await response.json();
        console.log('Staff data:', data);
        if (response.ok) {
          setStats(data.stats);
          setPatients(data.patients);
        } else {
          setError(data.error || 'Failed to fetch data');
        }
      } catch (err) {
        console.error('Network error:', err);
        setError('Network error');
      }
    };
    fetchData();
  }, []);

  const checkInPatient = (patientId) => {
    // สมมติส่ง request ไป backend เพื่ออัปเดต status
    fetch(`http://localhost:5001/api/patients/checkin/${patientId}`, {
      method: 'POST',
      headers: { 'Content-Type': 'application/json' },
    })
      .then((res) => res.json())
      .then((data) => {
        if (data.success) {
          setPatients(patients.map(p => p.patientId === patientId ? { ...p, status: 'Checked In' } : p));
          alert('Check-in successful!');
        }
      })
      .catch((err) => console.error('Check-in error:', err));
  };

  return (
    <div className="container mx-auto p-6 bg-white text-blue-800 min-h-screen">
      <h1 className="text-3xl font-bold mb-6 text-blue-600">Staff Dashboard</h1>
      {error && <div className="text-red-500 mb-4">{error}</div>}
      <div className="grid grid-cols-1 md:grid-cols-3 gap-4 mb-6">
        <div className="bg-gray-100 p-4 rounded-lg shadow">
          <h2 className="text-lg font-semibold">Total Patients</h2>
          <p className="text-2xl">{stats.total}</p>
        </div>
        <div className="bg-gray-100 p-4 rounded-lg shadow">
          <h2 className="text-lg font-semibold">Checked In</h2>
          <p className="text-2xl">{stats.checkedIn}</p>
        </div>
        <div className="bg-gray-100 p-4 rounded-lg shadow">
          <h2 className="text-lg font-semibold">Not Checked In</h2>
          <p className="text-2xl">{stats.notCheckedIn}</p>
        </div>
      </div>
      <div className="bg-gray-100 p-4 rounded-lg shadow">
        <h2 className="text-xl font-semibold text-gray-700 mb-2">Patient List</h2>
        <table className="w-full border-collapse border border-blue-300">
          <thead>
            <tr className="bg-blue-100">
              <th className="border border-blue-300 p-2">Patient ID</th>
              <th className="border border-blue-300 p-2">Name</th>
              <th className="border border-blue-300 p-2">Status</th>
              <th className="border border-blue-300 p-2">Action</th>
            </tr>
          </thead>
          <tbody>
            {patients.map((patient) => (
              <tr key={patient.patientId} className="hover:bg-blue-50">
                <td className="border border-blue-300 p-2">{patient.patientId}</td>
                <td className="border border-blue-300 p-2">{patient.fullName}</td>
                <td className="border border-blue-300 p-2">{patient.status || 'Pending'}</td>
                <td className="border border-blue-300 p-2">
                  <button
                    onClick={() => checkInPatient(patient.patientId)}
                    className="bg-green-500 text-white px-4 py-2 rounded hover:bg-green-600"
                    disabled={patient.status === 'Checked In'}
                  >
                    Check In
                  </button>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
}

export default StaffDashboard;
